import sys

def solve_case(vals):
    n, k, l, c, d, p, nl, np = vals
    total_ml = k * l
    drinks_toasts = total_ml // nl
    lime_slices = c * d
    salt_toasts = p // np
    return min(drinks_toasts, lime_slices, salt_toasts) // n

def main():
    data = list(map(int, sys.stdin.read().strip().split()))
    if not data:
        return
    tests = []
    if len(data) == 8:
        tests = [data]
    elif (len(data) - 1) % 8 == 0 and data[0] == (len(data) - 1) // 8:
        t = data[0]
        idx = 1
        for _ in range(t):
            tests.append(data[idx:idx+8])
            idx += 8
    elif len(data) % 8 == 0:
        idx = 0
        while idx < len(data):
            tests.append(data[idx:idx+8])
            idx += 8
    else:
        # fallback: try to read as many full cases as possible from start
        idx = 0
        while idx + 8 <= len(data):
            tests.append(data[idx:idx+8])
            idx += 8

    outputs = [str(solve_case(tc)) for tc in tests]
    sys.stdout.write("\n".join(outputs))

if __name__ == "__main__":
    main()
